function initCityAutocomplete(elem) {

  // elem.



  // Create the autocomplete object, restricting the search to geographical

  // location types.

  var autocomplete = new google.maps.places.Autocomplete(elem, autoCompleteSettings);



  google.maps.event.addDomListener(elem, 'keydown', function(event) { 

    if (event.keyCode === 13) { 

        event.preventDefault(); 

    }

  });



  // When the user selects an address from the dropdown, populate the address

  // fields in the form.

  autocomplete.addListener('place_changed', function() {

    fillInAddress(elem, this); 

  });

}

function initAutocomplete() {



var autocompletes = document.getElementsByClassName("autocomplete");



for (var i = 0; i < autocompletes.length; i++) {

  var elem = autocompletes[i];

  // Create the autocomplete object, restricting the search to geographical

  // location types.

  var autocomplete = new google.maps.places.Autocomplete(
    /** @type {!HTMLInputElement} */(elem),
    autoCompleteSettings);



  google.maps.event.addDomListener(elem, 'keydown', function(event) { 

    if (event.keyCode === 13) { 

        event.preventDefault(); 

    }

  }); 



  // When the user selects an address from the dropdown, populate the address

  // fields in the form.

  autocomplete.ifsoElem = elem;

  autocomplete.addListener('place_changed', function() {

    fillInAddress(this.ifsoElem, this);

  });



}
}



